import Link from 'next/link';
import Layout from "../components/Layout";

export default () => (
    <Layout title="About">
        <div>
            <h1>About</h1>
            <Link href="/"><a>Go to the home page</a></Link>
            <p>A JavaScript Programmer</p>
            <img src="/static/logo.png" alt="JS" height="200px"/>
        </div>
    </Layout>
);
